import React from "react";

const Generate = () => {
  return (
    <>
      <div className="howto">
        <h1>How to make AI images</h1>
        <form className="prompt_field">
          <input type="text" placeholder="Prompt" name="generate" />
          <button type="submit">
            <i className="fa fa-search">Generate</i>
          </button>
        </form>
      </div>
    </>
  );
};

export default Generate;
